-- need to not allow users to register same username with many phones
-- need to have a way for a user to remove old phone if they got a new phone

drop table if exists Nodes;
drop table if exists GridLevel5;
drop table if exists GridLevel4;
drop table if exists GridLevel3;
drop table if exists GridLevel2;
drop table if exists GridLevel1;
drop table if exists Users;
drop table if exists UserPhones;
drop table if exists Phones;
drop table if exists Manufacturer;
drop table if exists Carrier;

CREATE TABLE IF NOT EXISTS Carrier (
  id int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(20) NOT NULL,
  PRIMARY KEY (id)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 AUTO_INCREMENT=4 ;


CREATE TABLE IF NOT EXISTS Manufacturer (
  id int(11) NOT NULL,
  `name` varchar(20) NOT NULL,
  PRIMARY KEY (id)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


create table Phones(
  id int unsigned zerofill auto_increment primary key,
  manufacturerID int references Manufacturer,
  model varchar(40)
  )ENGINE=MyISAM DEFAULT CHARSET=utf8;
  

create table UserPhones(
  id int unsigned zerofill auto_increment primary key,
  phoneID int references Phones,
  identifier varchar(40) unique
  )ENGINE=MyISAM DEFAULT CHARSET=utf8;
  
  
create table Users(
  id int unsigned zerofill auto_increment primary key,
  userPhoneID int references UserPhones,
  username varchar(30) unique,
  `password` varchar(40),
  email varchar(50) unique
  );
  
  
CREATE TABLE IF NOT EXISTS GridLevel1 (
  id int(11) NOT NULL AUTO_INCREMENT,
  gss1x tinyint(2) NOT NULL,
  gss1y tinyint(2) NOT NULL,
  avgrec float(6,4) NOT NULL,
  numuploads smallint(6) NOT NULL,
  carrier tinyint(4) NOT NULL,
  network float(6,4) NOT NULL,
  PRIMARY KEY (id),
  KEY gss1x (gss1x,gss1y)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 AUTO_INCREMENT=4 ;


CREATE TABLE IF NOT EXISTS GridLevel2 (
  id int(11) NOT NULL AUTO_INCREMENT,
  gss2x int(2) unsigned NOT NULL,
  gss2y int(2) unsigned NOT NULL,
  avgrec float(6,4) NOT NULL,
  numuploads smallint(6) NOT NULL,
  carrier tinyint(4) NOT NULL,
  network float(6,4) NOT NULL,
  PRIMARY KEY (id),
  KEY gss2x (gss2x,gss2y)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 AUTO_INCREMENT=5 ;


CREATE TABLE IF NOT EXISTS GridLevel3 (
  id int(11) NOT NULL AUTO_INCREMENT,
  gss3x int(2) unsigned NOT NULL,
  gss3y int(2) unsigned NOT NULL,
  avgrec float(6,4) NOT NULL,
  numuploads smallint(6) NOT NULL,
  carrier tinyint(4) NOT NULL,
  network float(6,4) NOT NULL,
  PRIMARY KEY (id),
  KEY gss3x (gss3x,gss3y)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 AUTO_INCREMENT=108 ;


CREATE TABLE IF NOT EXISTS GridLevel4 (
  id int(11) NOT NULL AUTO_INCREMENT,
  gss4x int(2) unsigned NOT NULL,
  gss4y int(2) unsigned NOT NULL,
  avgrec float(6,4) NOT NULL,
  numuploads smallint(6) NOT NULL,
  carrier tinyint(4) NOT NULL,
  network float(6,4) NOT NULL,
  PRIMARY KEY (id),
  KEY gss4x (gss4x,gss4y)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 AUTO_INCREMENT=521 ;


CREATE TABLE IF NOT EXISTS GridLevel5 (
  id int(11) NOT NULL AUTO_INCREMENT,
  gss5x int(2) unsigned NOT NULL,
  gss5y int(2) unsigned NOT NULL,
  avgrec float(6,4) NOT NULL,
  numuploads smallint(6) NOT NULL,
  carrier tinyint(4) NOT NULL,
  network float(6,4) NOT NULL,
  PRIMARY KEY (id),
  KEY gss5x (gss5x,gss5y)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 AUTO_INCREMENT=761 ;


CREATE TABLE IF NOT EXISTS Nodes (
  id int(10) unsigned zerofill NOT NULL AUTO_INCREMENT,
  latitude float(8,5) NOT NULL,
  longitude float(8,5) NOT NULL,
  network varchar(10) NOT NULL,
  `signal-strength` tinyint(4) NOT NULL DEFAULT '-1',
  carrier varchar(20) NOT NULL,
  phone varchar(50) NOT NULL,
  manufacturer varchar(20) NOT NULL,
  username varchar(30) NOT NULL,
  gsm int(11) DEFAULT NULL,
  gsmerror int(11) DEFAULT NULL,
  cdma int(11) DEFAULT NULL,
  cdmaerror int(11) DEFAULT NULL,
  evdo int(11) DEFAULT NULL,
  evdoerror int(11) DEFAULT NULL,
  phonetype varchar(20) NOT NULL,
  deviceid varchar(30) NOT NULL,
  networkint int(11) NOT NULL,
  `time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (id)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 AUTO_INCREMENT=15481 ;

